import React from 'react';
import s from './Price.module.css';
import { NavLink } from 'react-router-dom';
import Pattern from '../../images/reviewsImage/Pattern.png';
const Price = () => {
    return (
        <div className={s.price}>
            <p className={s.titleText}>Что вас интересует?</p>
            <NavLink to='/price/modelPhoto'><div className={s.modelPhoto}><span>Модельные фотосессии</span></div></NavLink>
            <NavLink to='/price/featureVideo'><div className={s.featureVideo}><span>Художественные видео</span></div></NavLink>
            <NavLink to='/price/visualManagerInst'><div className={s.visualManagerInst}><span>Визуал-менеджер в Instagram</span></div></NavLink>
            <NavLink to='/price/addServices'><div className={s.addServices}><span>Дополнительные услуги</span></div></NavLink>
            <div><img className={s.pattern} src={Pattern}></img></div>
        </div>
    );
};

export default Price;
